From glitz and glamour to the hard work behind the scenes , my journey in this pageant has nothing short of transformative. I have learned the true meaning of resilience, self confidence and the power of sisterhood . This experience has shaped me into a stronger,  more determined version of myself and I'm so proud of how far i have come from a small village to a big city ; from small shows to one of the biggest pageant show (Mega Miss North East ) . Here's  to embracing every challenge and celebrating every victory .Thank you so much to the entire MMNE team🙏
